package Introduction.Oprators;

public class IncreDecreMethoda {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x=10;
        for(int i=5;i<=x;i++)
        System.out.println("Increment is " + i);
        for(int i=20;i>=x;i--)
        System.out.println("Decrement is" + i);

	}

}
